import React, { useState } from 'react';
import { MapContainer, TileLayer, ImageOverlay, useMapEvents } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import axios from 'axios';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';
import { Line } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

// Helper to capture map movements
function MapController({ onBoundsChange }) {
  const map = useMapEvents({
    moveend: () => onBoundsChange(map.getBounds()),
    zoomend: () => onBoundsChange(map.getBounds()),
  });
  return null;
}

function App() {
  const [currentBounds, setCurrentBounds] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [loading, setLoading] = useState(false);

  // Mock Graph Data
  const chartData = {
    labels: ['Jan', 'Feb', 'Mar', 'Now'],
    datasets: [{
      label: 'Water Level (%)',
      data: [40, 42, 38, analysisResult?.water_percentage || 0],
      borderColor: '#00d2ff',
      backgroundColor: 'rgba(0, 210, 255, 0.5)',
    }]
  };

  const handleAnalyze = async () => {
    if (!currentBounds) {
      alert("Please move the map slightly to initialize bounds.");
      return;
    }
    setLoading(true);
    
    // Get coordinates from Leaflet
    const bbox = [
        currentBounds.getSouth(), currentBounds.getWest(),
        currentBounds.getNorth(), currentBounds.getEast()
    ];

    try {
      // Call Node Backend
      const res = await axios.post('http://localhost:3000/api/coastal-analysis', {
        bbox: bbox,
        date: '2023-11-20'
      });
      setAnalysisResult(res.data);
    } catch (err) {
      console.error(err);
      alert("Backend error. Is Node running?");
    }
    setLoading(false);
  };

  return (
    <div style={{ display: 'flex', flexDirection: 'column', height: '100vh', fontFamily: 'Arial, sans-serif' }}>
      
      {/* HEADER */}
      <header style={{ padding: '15px', background: '#222', color: 'white', display: 'flex', justifyContent: 'space-between' }}>
        <h2 style={{ margin: 0 }}>üõ∞Ô∏è CoAspire</h2>
        <button 
          onClick={handleAnalyze} 
          disabled={loading}
          style={{ padding: '10px 20px', background: loading ? '#555' : '#007bff', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}>
          {loading ? 'Processing...' : 'Analyze Current View'}
        </button>
      </header>

      <div style={{ display: 'flex', flex: 1 }}>
        
        {/* MAP SECTION */}
        <div style={{ flex: 3, position: 'relative' }}>
          <MapContainer center={[19.8, 85.8]} zoom={11} style={{ height: '100%', width: '100%' }}>
            
            {/* SATELLITE TILE LAYER (Esri) */}
            <TileLayer
              attribution='Tiles &copy; Esri'
              url="https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}"
            />
            
            {/* AI OVERLAY LAYER */}
            {analysisResult && currentBounds && (
              <ImageOverlay 
                url={analysisResult.mask_image} 
                bounds={currentBounds} 
                opacity={0.6}
              />
            )}

            <MapController onBoundsChange={setCurrentBounds} />
          </MapContainer>
        </div>

        {/* SIDEBAR */}
        <div style={{ flex: 1, padding: '20px', background: '#f4f4f4', borderLeft: '2px solid #ccc' }}>
          <h3>Coastal Analytics</h3>
          {analysisResult && (
            <div style={{ background: 'white', padding: '15px', borderRadius: '8px', marginBottom: '20px' }}>
              <h1 style={{ color: '#007bff', margin: 0 }}>{analysisResult.water_percentage}%</h1>
              <small>Water Coverage Detected</small>
            </div>
          )}
          <div style={{ height: '200px' }}>
             <Line data={chartData} options={{ maintainAspectRatio: false }} />
          </div>
        </div>

      </div>
    </div>
  );
}

export default App;
